import React from "react"

const SearchResult = (props)=>(
    rendorResult(props)

)

function rendorResult(props){

    console.log(props.results)

    return(
        props.results.map((elem,i) =>{
            return(
                <div key={i} className="card col-sm-12">
                    <div className ="card-title">{elem.volumeInfo.title}</div>
                    <p><img src={elem.volumeInfo.imageLinks.thumbnail}/>{elem.volumeInfo.description}</p>
                </div>
            )
        })

    )

}

export default SearchResult
